// Ambil data email pertama
const email = items[0].json;

// ============================================
// 1. AMBIL TICKET ID DARI SUBJECT
// ============================================
// Contoh Subject: "New QC Ticket: TKT-056179-4262"
const subject = email.Subject || "";

// Regex cari "TKT-" diikuti angka/huruf/strip
const ticketIdMatch = subject.match(/TKT-[\w\d-]+/);
const ticketID = ticketIdMatch ? ticketIdMatch[0] : null;

// ============================================
// 2. AMBIL ISI LAPORAN DARI SNIPPET
// ============================================
// Contoh Snippet: "Root Cause: Sensor pH kotor Corrective Action: ... Closed By: Myname --- ..."
let snippet = email.snippet || "";

// Bersihkan simbol HTML entitas (misal &amp; jadi &)
snippet = snippet.replace(/&amp;/g, "&").replace(/&lt;/g, "<").replace(/&gt;/g, ">");

// Regex untuk mengambil data di antara kata kunci
// A. Root Cause: Ambil teks antara "Root Cause:" DAN "Corrective Action:"
const rootCauseMatch = snippet.match(/Root Cause:\s*(.+?)\s*Corrective Action:/i);

// B. Corrective Action: Ambil teks antara "Corrective Action:" DAN "Closed By:"
const correctiveMatch = snippet.match(/Corrective Action:\s*(.+?)\s*Closed By:/i);

// C. Closed By: Ambil teks setelah "Closed By:" sampai ketemu tanda "---" atau akhir kalimat
const closedByMatch = snippet.match(/Closed By:\s*(.+?)(\s*---|(?=$))/i);

// ============================================
// 3. OUTPUT FINAL
// ============================================
return [{
  json: {
    ticket_id: ticketID, // ID dari Subject
    ticket_status: "Closed",
    Closed_at: new Date().toISOString(),

    // Ambil hasil regex grup ke-1, lalu trim spasi
    Root_Cause: rootCauseMatch ? rootCauseMatch[1].trim() : "N/A",
    Corrective_Action: correctiveMatch ? correctiveMatch[1].trim() : "N/A",

    // Closed By dari snippet, atau fallback ke pengirim email
    "Assigned (To) Email": closedByMatch ? closedByMatch[1].trim() : (email.From || "Unknown")
  }
}];

// ==========================================
// 1. SETUP THRESHOLD (Data Standar)
// ==========================================
const thresholdItems = $('baca_threshold').all();
const limits = {};

thresholdItems.forEach(item => {
  const t = item.json;
  if (t.Parameter) limits[t.Parameter] = t;
});

// ==========================================
// 2. SETUP HELPER FUNCTIONS (OTAK TIKETING)
// ==========================================

// A. Menentukan PIC berdasarkan parameter yang gagal
function getAssignedPICs(failedList) {
  // Gabungkan semua error jadi satu string kecil biar mudah dicek
  const text = failedList.join(" ").toLowerCase();

  let recipients = [];
  let emails = [];

  // Logika Pembagian Tugas
  if (text.includes("berat")) {
    recipients.push("Divisi_Produksi");
    emails.push("bintang.pandu87@gmail.com");
  }
  if (text.includes("ph")) {
    recipients.push("Divisi_QA");
    emails.push("ryuga.kyuji@gmail.com");
  }
  if (text.includes("dimensi")) {
    recipients.push("Divisi_QC");
    emails.push("jordanjeremi8@gmail.com");
  }
  if (text.includes("visual")) {
    recipients.push("Divisi_DP");
    emails.push("paperian1880@gmail.com");
  }

  // Fallback jika error tidak terdeteksi
  if (recipients.length === 0) {
    recipients.push("QC_Default");
    emails.push("acct19907@gmail.com");
  }

  return { names: recipients.join(", "), emails: emails.join(",") };
}

// B. Menentukan Severity (Keparahan)
function calculateSeverity(failedList) {
  if (failedList.length >= 3) return "High";
  if (failedList.length === 2) return "Medium";
  return "Low";
}

// C. Menentukan SLA Deadline
function getSlaDeadline(severity) {
  const now = new Date();
  if (severity === "High") now.setHours(now.getHours() + 4);       // +4 Jam
  else if (severity === "Medium") now.setHours(now.getHours() + 8);// +8 Jam
  else now.setHours(now.getHours() + 24);                          // +24 Jam
  return now.toISOString();
}

// ==========================================
// 3. AMBIL DATA INPUT & PROSES LOOPING
// ==========================================
const inputRows = $('baca_response_form').all().map(item => item.json);

return inputRows.map(row => {

  let failedParams = [];
  let passed = true;

  // --- A. Cek Berat (g) ---
  const thrBerat = limits["Berat (g)"];
  if (thrBerat) {
    const nilai = parseFloat(row["Berat (g)"]);
    if (nilai < thrBerat.Min || nilai > thrBerat.Max) {
      passed = false;
      failedParams.push(`Berat tidak sesuai (${nilai}g)`);
    }
  }

  // --- B. Cek pH ---
  const thrPh = limits["pH"];
  if (thrPh) {
    const nilai = parseFloat(row["pH"]);
    if (nilai < thrPh.Min || nilai > thrPh.Max) {
      passed = false;
      failedParams.push(`pH tidak sesuai (${nilai})`);
    }
  }

  // --- C. Cek Dimensi (mm) ---
  const thrDim = limits["Dimensi (mm)"]; 
  if (thrDim) {
    const nilai = parseFloat(row["Dimensi (mm)"]);
    if (nilai < thrDim.Min || nilai > thrDim.Max) {
      passed = false;
      failedParams.push(`Dimensi tidak sesuai (${nilai}mm)`);
    }
  }

  // --- D. Cek Visual Defect ---
  const thrVis = limits["Visual Defect"];
  const valVis = row["Visual Defect"];
  if (thrVis && valVis === thrVis.Min) {
    passed = false;
    failedParams.push(`Visual Defect ditemukan: ${valVis}`);
  }

  // ==========================================
  // 4. HITUNG DATA TIKET (JIKA FAILED)
  // ==========================================

  let ticketData = {
    id: null,
    severity: null,
    sla: null,
    picName: null,
    picEmail: null,
    qrUrl: null
  };

  if (!passed) {
    // 1. Generate ID
    ticketData.id = "TKT-" + Date.now().toString().slice(-6) + "-" + row["ID Produk"];

    // 2. Hitung Severity & SLA
    ticketData.severity = calculateSeverity(failedParams);
    ticketData.sla = getSlaDeadline(ticketData.severity);

    // 3. Tentukan PIC
    const picInfo = getAssignedPICs(failedParams);
    ticketData.picName = picInfo.names;
    ticketData.picEmail = picInfo.emails;

    // 4. Generate QR Code URL
    ticketData.qrUrl = `https://api.qrserver.com/v1/create-qr-code/?size=200x200&data=${ticketData.id}`;
  }

  // ==========================================
  // 5. OUTPUT FINAL JSON
  // ==========================================
  return {
    json: {
      ...row, 
      "row_number": row.row_number,

      "qc_status": passed ? "PASSED" : "FAILED",
      "Parameter Gagal": failedParams.join(", "),

      "ticket_id": ticketData.id,
      "Severity": ticketData.severity,
      "Sla_Deadline": ticketData.sla,
      "Assigned (To)": ticketData.picName,
      "Assigned_at": passed ? null : new Date().toISOString(),
      "Pic_Email": ticketData.picEmail,
      "QR_Code_Url": ticketData.qrUrl,

      "ticket_status": passed ? null : "Open",
      "ticket_created_at": passed ? null : new Date().toISOString(),

      // --- TAMBAHAN YANG HILANG ---
      "Escalation_Level": passed ? null : 0,  // Default mulai dari 0
      "Is_sla_Overdue": passed ? null : "No", // Default belum telat
      // ----------------------------

      "processed_at": new Date().toISOString()
    }
  };
});
